                {
                  obj2 && obj2.map((item, index) => {
                    return (
                      <li key={index}> <Link to={"/detail/" + item.name}> <strong>{item.name}</strong> <br></br>({item.children.length} components) </Link> </li>
                    )
                  })
                }
              </ul>
            </div>
          </div>
          <style jsx>{`
        .App {
          text-align: left;
          margin: 30px;
